import React from 'react'
import Axios from 'axios'

function Databases(){

    const [array, setArray] = React.useState([]);

    React.useEffect(() => {
        try {
            Axios.get("/test").then((response) => {
                setArray(response.data.rows)
            })
        } catch (err){
            console.log(err);
        }
    }, [])

    return(
        <div>
            <h1>Databases</h1>
            <div>
                {array.forEach(ele => {
                    console.log(ele)
                return <p>{ele}</p>
                })}
            </div>
        </div>
    )
}

export default Databases;
